import React from "react";
import { Card, Row, Badge, Button } from "react-bootstrap";

const SinglePost = ({ post: { _id, status, title, description, url } }) => {
  return (
    <Card
      className="shadow"
      border={
        status === "LEARNED"
          ? "success"
          : status === "LEARNING"
          ? "warning"
          : "danger"
      }
    >
        <Card.Body>
            <Card.Title>
                <Route>
                    <Col>
                    <p className='post-title'>
                    {title}
                    </p>
                    <Badge pill variant=''></Badge>
                    </Col>
                </Route>
            </Card.Title>
        </Card.Body>
    </Card>
  );
};

export default SinglePost;
